post_text:
Renton Schools Foundation supports students, teachers, and support staff in every school in the district with funding for
• literacy programs;
• music;
• Science, Technology, Engineering, and Mathematics (STEM) programs;
• summer camps;
• grants directly to teachers; and
• more.

Those needs continue now more than ever.

Please consider giving to Renton Schools Foundation tomorrow, Tuesday, May 5, as part of the regional Give Big campaign.

Also, check with your company or organization to see if they match your generous donation.

Give now at https://www.givebigwa.org/rentonschoolsfoundation

